export default function Song({ songtitle, artist, year }) 
{
  return (
    <button onDoubleClickCapture={onDoubleClickCaptureHandler}>
    <h1 id="title">{songtitle}</h1>
    <h1 id="subtitle">Artist: {artist} Year: {year}</h1>
    </button>

  );
}
